import React from 'react'

export default class Day extends React.Component{


    createDay = () => {
        if (this.state.selected === false){
            return <span className='day' onClick={this.props.selectDay}>
                {this.props.num}
            </span>
        }
    }

    render(){
        return <Fragment>{this.createDay}</Fragment>
    }
}
